import React from 'react'
import './ProjectElement.css'

function ProjectElement(props, {gallery}) {
    return (
        <div>
            <div>{props.description}</div>
            <ul>
                {props.technology}
            </ul>
            <a>{props.link}</a>
            <ul>{gallery.map(item => (<li>{item.name}</li>))}</ul>
        </div>
    )
}

export default ProjectElement
